* 我参考 [史上最优雅的NDK加载pass方案](https://xz.aliyun.com/news/6247) 这篇文章修改了代码，然后编译成功
* 基于`main`[android-ndk-support](https://github.com/0x1306a94/ollvm17/tree/android-ndk-support)
* 通过如下命令编译,只要添加混淆参数就会crash
* 然后我用这个[Hikari-LLVM19](https://github.com/0x1306a94/Hikari-LLVM19/tree/android-ndk-support) 可以编译，只是`cffobf` `indibran` 这两个选项会添加其一就会crash

```c
// test_ollvm.c
#include <stdio.h>
#include <stdlib.h>
void testpass(int age) {
    if (age < 18) {
        printf("You are a minor.\n");
    } else {
        printf("You are an adult.\n");
    }
}

int test_func(int a) {
    if (a < 10) return a * a;
    if (a > 10) return a + a;
    return -1;
}

int test_func_fla(int a) {
    if (a < 10) return a * a;
    if (a > 10) return a + a;
    return -1;
}

int test_func_fla_bcf(int a) {
    if (a < 10) return a * a;
    if (a > 10) return a + a;
    return -1;
}

void test_ollvm() {
    printf("Testing OLLVM...\n");
    int age = 20;  // Example age
    testpass(age);
    test_func(5);
    test_func_fla(10);
    test_func_fla_bcf(20);
    printf("Test completed.\n");
}

```
```bash
$ANDROID_NDK_ROOT/toolchains/llvm/prebuilt/darwin-x86_64/bin/clang++ --target=aarch64-linux-android23 \
-Xclang -load -Xclang xxx/libObfuscation.so \
-fplugin=xxx/libObfuscation.so \
-shared -fPIC -O2 \
-mllvm -fla -mllvm -bcf -mllvm -bcf_prob=80 -mllvm -bcf_loop=3 -mllvm -sobf -mllvm -icall -mllvm -ibr -mllvm -igv -mllvm -sub -mllvm -sub_loop=3 -mllvm -split -mllvm -split_num=5 \
-o test.so  ../examples/test_ollvm.c
```

